ga58(){return"2. Application Status"},
ga50(){return"The Application is an unofficial third-party client and is not developed, affiliated with, or supported by Tyumen State University (UTMN) or the developers of the Modeus platform. All trademarks and logos of UTMN and Modeus are the property of their respective owners."},
ga59(){return"3. License to Use"},
ga51(){return"We grant you a non-exclusive, non-transferable, revocable license to use the Application for personal, non-commercial educational purposes."},
ga5a(){return"4. Limitation of Liability"},
ga52(){return'Data Accuracy: The Application displays data "as is," receiving it from the Modeus system. We cannot guarantee its absolute accuracy, completeness, or timeliness. Always check official sources for critically important information.\n\nService Availability: The operation of the Application depends directly on the availability of the UTMN and Modeus servers. We are not responsible for the temporary unavailability of the service for technical reasons beyond our control.\n\nConsequences: The developer is not responsible for any academic, financial, or other problems (e.g., missing a class or exam) arising from the use or inability to use the Application.'},
ga5b(){return"5. User Responsibilities"},
